import React, { useState } from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import bannerImage from '../assets/images/purpleBanner.png';
import '../assets/fonts/Poppins-Regular.ttf';
import '../assets/fonts/Quicksand-Regular.ttf';

const Contact = () => {
    // State variables to store form input values
    const [formData, setFormData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        topic: '',
        message: '',
    });

    // Handler to update state on input change
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    // Handler for form submission
    const handleSubmit = () => {
        // Send the formData to the backend (e.g., via an API call)
        console.log('Form Data Submitted:', formData);
        // You can replace the above line with an actual API call
    };

    return (
        <div>
            <Header />

            {/* Banner Section */}
            <div style={styles.banner}>
                <h1 style={styles.bannerText}>Contact</h1>
            </div>

            {/* Main Content Section */}
            <div style={styles.contentSection}>
                <h2 style={styles.title}>Get in Touch with Us!</h2>
                <p style={styles.text}>
                    Have any questions or need assistance? We’re here to help. Fill out the form below, and we’ll get back to you as soon as possible.
                </p>

                {/* Contact Form */}
                <div style={styles.formContainer}>
                    {/* First Name */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>First Name</label>
                        <input
                            type="text"
                            name="firstName"
                            value={formData.firstName}
                            onChange={handleInputChange}
                            placeholder="Enter First Name"
                            style={styles.inputBox}
                        />
                    </div>

                    {/* Last Name */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Last Name</label>
                        <input
                            type="text"
                            name="lastName"
                            value={formData.lastName}
                            onChange={handleInputChange}
                            placeholder="Enter Last Name"
                            style={styles.inputBox}
                        />
                    </div>

                    {/* Email */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Email</label>
                        <input
                            type="email"
                            name="email"
                            value={formData.email}
                            onChange={handleInputChange}
                            placeholder="Enter Email"
                            style={styles.inputBox}
                        />
                    </div>

                    {/* Topic */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Topic</label>
                        <input
                            type="text"
                            name="topic"
                            value={formData.topic}
                            onChange={handleInputChange}
                            placeholder="Select Topic"
                            style={styles.inputBox}
                        />
                    </div>

                    {/* Message */}
                    <div style={styles.inputGroup}>
                        <label style={styles.label}>Message</label>
                        <textarea
                            name="message"
                            value={formData.message}
                            onChange={handleInputChange}
                            placeholder="Enter Message"
                            style={styles.textareaBox}
                        />
                    </div>

                    {/* Submit Button */}
                    <div style={styles.submitButton} onClick={handleSubmit}>
                        <span style={styles.submitText}>Submit</span>
                    </div>
                </div>
            </div>

            <Footer />
        </div>
    );
};

const styles = {
    banner: {
        width: '100%',
        height: '220px',
        backgroundImage: `url(${bannerImage})`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    bannerText: {
        color: 'black',
        fontFamily: 'Caprasimo',
        fontSize: '56px',
    },
    contentSection: {
        background: '#F7F5EF',
        padding: '60px 160px',
        textAlign: 'center',
    },
    title: {
        color: '#5A4283',
        fontSize: '32px',
        fontFamily: 'Quicksand',
        fontWeight: '500',
        marginBottom: '20px',
    },
    text: {
        color: 'black',
        fontSize: '16px',
        fontFamily: 'Poppins',
        fontWeight: '500',
        marginBottom: '40px',
    },
    formContainer: {
        width: '100%',
        maxWidth: '600px',
        padding: '24px',
        background: 'white',
        borderRadius: '8px',
        border: '1px solid #C4BAA2',
        display: 'flex',
        flexDirection: 'column',
        gap: '24px',
        margin: '0 auto',
        alignItems: 'flex-start',
        textAlign: 'left',
    },
    inputGroup: {
        alignSelf: 'stretch',
        display: 'flex',
        flexDirection: 'column',
        gap: '8px',
    },
    label: {
        alignSelf: 'stretch',
        color: '#1E1E1E',
        fontSize: '16px',
        fontFamily: 'Poppins',
        fontWeight: '500',
    },
    inputBox: {
        width: '100%',
        padding: '12px 16px',
        borderRadius: '8px',
        border: '1px solid #C4BAA2',
        fontSize: '16px',
        fontFamily: 'Poppins',
    },
    textareaBox: {
        width: '100%',
        padding: '12px 16px',
        borderRadius: '8px',
        border: '1px solid #C4BAA2',
        fontSize: '16px',
        fontFamily: 'Poppins',
        minHeight: '100px',
    },
    submitButton: {
        alignSelf: 'stretch',
        padding: '12px',
        background: '#78B27B',
        borderRadius: '8px',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        cursor: 'pointer',
    },
    submitText: {
        color: 'white',
        fontSize: '16px',
        fontFamily: 'Poppins',
        fontWeight: '500',
    },
};

export default Contact;
